INSERT INTO `place_details` VALUES (2,'<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>\r\n<p>&nbsp;</p>\r\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>','2021-07-26 14:32:13','2021-08-09 17:40:40',1,1,1,0),(3,'<p>Atlanta\'s hottest rooftop party.</p>\r\n<p>Jazz on Thursday nights.</p>\r\n<p>Comedy on Friday nights.</p>','2021-08-03 16:16:17','2021-08-03 16:16:17',3,1,1,0),(4,'<p>Lively dance club popular for pouring shots of alcohol &amp; featuring DJs and weekend food trucks</p>','2021-08-30 02:29:28','2021-08-30 02:29:28',148,1,1,0),(5,'<p>Energetic, neon-lit night spot with trapeze dancers, burlesque shows, DJs &amp; live music performances</p>\r\n<p>&nbsp;</p>','2021-08-30 12:25:13','2021-08-30 12:25:13',29,1,1,0),(6,'<p>Famous DJs spin tunes until early morning in this trendy, happening club with a rooftop terrace</p>\r\n<p>&nbsp;</p>','2021-08-30 12:27:41','2021-08-30 12:27:41',30,1,1,0),(7,'<p>Outdoor spot with a shabby-chic feel &amp; Latin music serving up craft cocktails, burger and more</p>','2021-08-30 12:30:58','2021-08-30 12:30:58',31,1,1,0),(8,'<p>7 different bars, DJs &amp; drag queens keep things lively until early morning at this mega dance club</p>\r\n<p>&nbsp;</p>','2021-08-30 12:34:20','2021-08-30 12:34:20',32,1,1,0),(9,'<p>Snug, dimly lit nightclub specializing in house music featuring guest DJs from around the world</p>','2021-08-30 12:48:54','2021-08-30 12:48:54',33,1,1,0),(10,'<p>Trendy, opulent Fontainebleau Hotel club where DJs spin at parties that attract celebs and VIPs</p>','2021-08-30 12:51:06','2021-08-30 12:51:06',34,1,1,0),(11,'<p>A stylishly dressed crowd congregates at this lively hangout with DJs, dancers &amp; bottle service</p>','2021-08-30 12:53:35','2021-08-30 12:53:35',35,1,1,0),(12,'<p>Combines the best of Miami and the city\'s top cabaret performer&nbsp;</p>\r\n<p>&nbsp;</p>','2021-08-30 12:55:49','2021-08-30 12:55:49',36,1,1,0),(13,'<p>Sprawling neon-lit nightclub offering 5 bars &amp; bottle service, plus a dance floor &amp; DJ music</p>','2021-08-30 12:57:41','2021-08-30 12:57:41',37,1,1,0),(14,'<p>Exclusive nightspot in the W Hotel boasts big-name DJs, a dramatically lit interior &amp; a chic crowd</p>\r\n<p>&nbsp;</p>','2021-08-30 12:59:17','2021-08-30 12:59:17',38,1,1,0),(15,'<p>This nightclub with famous DJs &amp; live dancers boasts an ice-skating rink &amp; bowling alley</p>\r\n<p>&nbsp;</p>','2021-08-30 13:01:20','2021-08-30 13:01:20',39,1,1,0),(16,'<p>Hot spot &amp; restaurant on the beach offering seafood amid chic decor</p>','2021-08-30 13:02:53','2021-08-30 13:02:53',40,1,1,0),(17,'<p>Mediterranean fare plus sushi &amp; wine served in a clubby and high energy setting with garden patio</p>\r\n<p>&nbsp;</p>','2021-08-30 13:05:28','2021-08-30 13:05:28',41,1,1,0),(18,'<p>EDM, techno &amp; house are the soundtrack at this dance club with funky jungle decor &amp; guest DJs</p>','2021-08-30 13:09:51','2021-08-30 13:09:51',42,1,1,0),(19,'<p>Global-inspired fare &amp; inventive cocktails served in a former fact