tio</p>','2021-09-05 14:31:29','2021-09-05 14:31:29',336,1,1,0),(333,'<p>Offbeat lounge with trippy decor, whimsical cocktails &amp; DJs (plus pizza from the shop next door)</p>','2021-09-05 14:38:27','2021-09-05 14:38:27',337,1,1,0),(334,'<p>Equal parts cocktail joint, snack bar, beauty salon &amp; massage parlor in funky, vintage-toned digs</p>','2021-09-05 14:38:51','2021-09-05 14:38:51',338,1,1,0),(335,'<p>Local venue with live music on Friday evenings, karaoke on Thursdays &amp; happy hour every night</p>','2021-09-05 14:43:11','2021-09-05 14:43:11',339,1,1,0),(336,'<p>Bustling lounge serving cocktails, craft beers &amp; Moroccan-influenced snacks in an atmospheric space</p>','2021-09-05 14:46:07','2021-09-05 14:46:07',340,1,1,0),(337,'<p>Retro neighborhood dive bar with outdoor tables, a jukebox &amp; occasional live music events</p>','2021-09-05 14:50:18','2021-09-05 14:50:18',341,1,1,0),(338,'<p>Envelops guests in a vibrant aesthetic and all walks of life are celebrated here. A futuristic fusion of Colorado mountain culture, local artists\' inspiration, and positive vibes brings to life this LUCID dream.&nbsp;</p>','2021-09-05 14:53:07','2021-09-05 14:53:07',342,1,1,0),(339,'<p>This modern lounge atop the 27-story Hyatt Regency offers cocktails, desserts &amp; panoramic views</p>','2021-09-05 14:55:26','2021-09-05 14:55:26',343,1,1,0),(340,'<p>Cheeky cocktails &amp; wines pair with inventive bites at this hip, stylish bar &amp; lounge with a patio</p>','2021-09-05 15:00:45','2021-09-05 15:00:45',344,1,1,0),(341,'<p>Luxurious Brown Hotel\'s cigar bar, filled with sofas &amp; dark wood &amp; serving premium booze &amp; snacks</p>','2021-09-05 15:03:48','2021-09-05 15:03:48',345,1,1,0),(342,'<p>Coloradan offshoot of the New York cocktail bar offering a sophisticated space for specialty drinks</p>','2021-09-05 15:30:21','2021-09-05 15:30:21',346,1,1,0),(343,'<p>Relaxed LGBTQ bar offering shots, coffee &amp; cocktails in a relaxed space with theme nights</p>','20